export const UPDATE_COUNT = "UPDATE_COUNT";
export const UPDATE_IDS = "UPDATE_IDS";

const getCount = (count : any) => ({
    type: UPDATE_COUNT,
    count
});

const getIds = (ids : [string]) => ({
    type: UPDATE_IDS,
    ids
});

export { getCount, getIds };
